import React from "react";

import styles from "./Homepage.module.css";

const Homepage = () => {
  return (
    <div>
      <section>
        <h1>Hello, I'm Jabez!</h1>
        <p>
          A Senior Computer Science Student passionate about software
          development, artificial intelligence, and web technologies. Welcome to
          my personal website!
        </p>
      </section>
    </div>
  );
};

export default Homepage;
